import React, { useState } from 'react';
import './navbar.css';

const Navbar = () => {
    const [isMenuOpen, setIsMenuOpen] = useState(false);

    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
    };

    return (
        <div>
            <div className='navbar'>
                <div className='logo'>
                    <img src="https://meme-token-gilt.vercel.app/assets/29231-B1Z16x30.png" alt="" />
                    <a>$URANUS</a>
                </div>
                <div className={`right-section ${isMenuOpen ? 'show' : ''}`}>
                    <form className={`form ${isMenuOpen ? 'show' : ''}`}>
                        <input className='input' type="search" placeholder='search' />
                        <button className='submit'>Submit</button>
                    </form>
                    <button className='button' onClick={toggleMenu}>Designed by Suraj Kumar Shaw</button>
                </div>
                <button className="menu-toggle" aria-label="Menu" aria-expanded={isMenuOpen} onClick={toggleMenu}>
                    <span className="line"></span>
                    <span className="line"></span>
                    <span className="line"></span>
                </button>
            </div>
        </div>
    );
};

export default Navbar;
